{
       align: 'center',
        render: row => {
          return h('div', {
            class: "flex-center gap-8px",
          },
            [
            hasAuth('user/submit')&&  h(Naive.NButton,
                {
                  ghost: true,
                  size: "small",
                  type: "primary",
                  onClick: () => {
                    that.openForm(row.id)
                  },
                },
                $t('common.edit')
              ),
            hasAuth('user/delete')&&h(Naive.NPopconfirm,
                {

                  onPositiveClick: () => {
                      that.handleDelete([row.id])
                  },
                },
                {
                  default: () => $t('common.confirmDelete'),
                  trigger: () => h(Naive.NButton,
                    {
                      type: "error",
                      size: "small",
                      ghost: true,
                    
                    },
                    $t('common.delete')
                  )
                }

              )


            ]
          )
        }
}

