{
    key: 'operate',
        title: $t('common.operate'),
            align: 'center',
                width: 230,
                    render: row => {
                        return h('div', {
                            class: "flex-center gap-8px",
                            onClick: () => {
                                that.handClick()
                            }
                        },
                            [
                           hasAuth('menu/submit')&&  row.menuType == Enum.MenuTypeEnum.目录 &&   h(Naive.NButton,
                                    {
                                        ghost: true,
                                        type: "primary",
                                        size: "small",
                                        onClick: () => {
                                             that.handleAddChildMenu(row)
                                        }
                                    },
                                    $t('page.manage.menu.addChildMenu')
                                ),
                          hasAuth('menu/submit')&&     row.menuType != Enum.MenuTypeEnum.按钮 &&  row.menuType != Enum.MenuTypeEnum.参数&&     h(Naive.NButton,
                                    {
                                        ghost: true,
                                        type: "primary",
                                        size: "small",
                                        onClick: () => {
                                             that.openForm(row.id)
                                        }
                                    },
                                    $t('common.edit')
                                ),
                            hasAuth('menu/delete')&&        h(Naive.NPopconfirm,
                                    {

                                        onPositiveClick: () => {
                                             that.handleDelete([row.id])
                                        },
                                    },
                                    {
                                        default: () => $t('common.confirmDelete'),
                                        trigger: () => h(Naive.NButton,
                                            {
                                                type: "error",
                                                size: "small",
                                                ghost: true
                                            },
                                            $t('common.delete')
                                        )
                                    }
                                )
                            ]
                        )
                    }
}

